import styled from 'styled-components';

export const WrapperNavbar = styled.nav`
  height: 66px;
  position: fixed;
  top: 0px;
  right: 0px;
  left: 0px;
  display: flex;
  z-index: 200;
  padding: 0 60px;
  background-color: rgb(31, 38, 45);
`;

export const WrapperLogo = styled.div`
  width: 120px;
  align-self: center;
`;
